import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const stats = [
    { title: 'Upcoming Appointments', value: '3', icon: 'üìÖ', color: 'bg-blue-500' },
    { title: 'Pending Tasks', value: '5', icon: '‚úÖ', color: 'bg-green-500' },
    { title: 'Health Records', value: '12', icon: 'üìä', color: 'bg-purple-500' },
    { title: 'Family Members', value: '4', icon: 'üë®‚Äçüë©‚Äçüëß‚Äçüë¶', color: 'bg-pink-500' },
  ];

  const recentActivity = [
    { type: 'Appointment', description: 'Doctor visit scheduled', time: '2 hours ago' },
    { type: 'Task', description: 'Medication reminder set', time: '4 hours ago' },
    { type: 'Health', description: 'Blood pressure recorded', time: '1 day ago' },
    { type: 'Communication', description: 'New message from Sarah', time: '2 days ago' },
  ];

  return (
    <div className="p-6">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <h1 className="text-2xl font-bold mb-6">Dashboard</h1>

        {/* Stats Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
          {stats.map((stat, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
              className={`${stat.color} rounded-lg p-6 text-white`}
            >
              <div className="flex items-center justify-between">
                <div>
                  <p className="text-sm opacity-80">{stat.title}</p>
                  <p className="text-2xl font-bold">{stat.value}</p>
                </div>
                <span className="text-3xl">{stat.icon}</span>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Quick Actions */}
        <div className="bg-white rounded-lg shadow-lg p-6 mb-8">
          <h2 className="text-xl font-semibold mb-4">Quick Actions</h2>
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
            <Link
              to="/calendar"
              className="bg-blue-50 p-4 rounded-lg text-center hover:bg-blue-100 transition"
            >
              <span className="text-2xl mb-2 block">üìÖ</span>
              Schedule Appointment
            </Link>
            <Link
              to="/tasks"
              className="bg-green-50 p-4 rounded-lg text-center hover:bg-green-100 transition"
            >
              <span className="text-2xl mb-2 block">‚úÖ</span>
              Add Task
            </Link>
            <Link
              to="/health"
              className="bg-purple-50 p-4 rounded-lg text-center hover:bg-purple-100 transition"
            >
              <span className="text-2xl mb-2 block">üìä</span>
              Record Health Data
            </Link>
            <Link
              to="/communication"
              className="bg-pink-50 p-4 rounded-lg text-center hover:bg-pink-100 transition"
            >
              <span className="text-2xl mb-2 block">üí¨</span>
              Send Message
            </Link>
          </div>
        </div>

        {/* Recent Activity */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Recent Activity</h2>
          <div className="space-y-4">
            {recentActivity.map((activity, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                className="flex items-center justify-between p-4 border-b last:border-b-0"
              >
                <div>
                  <p className="font-medium">{activity.type}</p>
                  <p className="text-gray-600">{activity.description}</p>
                </div>
                <span className="text-sm text-gray-500">{activity.time}</span>
              </motion.div>
            ))}
          </div>
        </div>
      </motion.div>
    </div>
  );
};

export default Dashboard;
